import { useState, useEffect } from "react";
import "../style/Main.css";
import axios from "axios";
import { Link } from 'react-router-dom'
const App = () => {
    const [id, setId] = useState();
    const [data, setData] = useState([]);
    const [error, setError] = useState('');
    const [myData, setMyData] = useState([]);
    const [isError, setIsError] = useState("");
    function findall() {
        // useEffect(() => {
        axios
            .get("http://localhost:8989/getAllStudent")
            .then((response) => {
                console.log(response.data)
                setMyData(response.data)
            })
            .catch((error) => setIsError(error.message));
    }
    // []);
    // }
    // using Promises
    function fin() {
        // useEffect(() => {
        axios
            .get("http://localhost:8989/getStudent?id=" + id)
            .then((response) => {
                setData(response.data)
                // if(response.data===null){
                //     console.log("error")
                // }
            });
        console.log(data);
        if (data === null) {
            // setError("NotFound");
            console.log("Error");
        }
        // .catch((error) => setIsError(error.message));
    }
    // []);}

    //plz subscribe to thapa technical
    return (
        <>
            <h1>users</h1>
            {/* {isError !== "" && <h2>{isError}</h2>} */}
            <div>

                <input type="number" placeholder='Enter ID Number' className="form-control1" value={id} onChange={(e) => setId(e.target.value)}>

                </input>
            </div>
            <button type="submit" class="btn btn-primary" onClick
                ={fin}>Submit</button>  &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
            <Link to='/Main'>
                <button type="submit" class="btn btn-primary"
                >Back</button></Link>
            {/* <div className="body"> */}
                <div className="card">
                    <table>
                        <tr>
                            <th>Name</th>
                            <th>Rollnumber</th>
                            <th>Age</th>
                            <th>Department</th>
                            <th>Address</th>
                        </tr>
                        <tr>
                            <td>{data.name}</td>
                            <td>{data.roll}</td>
                            <td>{data.age}</td>
                            <td>{data.department}</td>
                            <td>{data.address}</td>
                        </tr>
                    </table>
                </div>
            {/* </div> */}
            <div className='div'>
                <button type="submit" class="btn btn-primary" onClick
                    ={findall}>FindAll</button>
            </div>
            {isError !== "" && <h2>{isError}</h2>}

            <div className="grid">
                {/* <h1>All users</h1> */}
                {myData.slice(0, 8).map((post) => {
                    // const { body, id, title } = post;
                    return (
                        <div className="card">
                        <table>
                            <tr>
                                <th>Name</th>
                                <th>Rollnumber</th>
                                <th>Age</th>
                                <th>Department</th>
                                    <th>Address</th>
                            </tr>
                            <tr key={(post.id)}>
                                <td>{post.name}</td>
                                <td>{post.roll}</td>
                                <td>{post.age}</td>
                                <td>{post.department}</td>
                                <td>{post.address}</td>
                            </tr>
                        </table>
                        </div>
                    );
                })}
            </div>
        </>
    );
};

export default App;
